import React from 'react';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid, Legend, ResponsiveContainer } from 'recharts';

const notData = {
    labels: ["M", "T", "W", "T", "F", "S", "S"],
    series: {"Reed": [12, 17, 7, 17, 23, 18, 38], "Gary": [13, 19, 22, 10, 28, 18, 26]}
}

const series = notData.series;
const keys = Object.keys(notData.series);

const sampleData = []

for (var i = 0; i < keys.length; i++) {
    const dataSection = []
    for (var x = 0; x < series[keys[i]].length; x++) {
        dataSection.push([keys[i], series[keys[i]][x]]);
    }
    sampleData.push(dataSection)
}

const realData = []

for (var i = 0; i < sampleData[0].length; i++) {
    const obj1 = {"name": notData.labels[i]}
    for (var x = 0; x < sampleData.length; x++) {
        obj1[sampleData[x][i][0]] = sampleData[x][i][1];
    }
    realData.push(obj1)
}

const data = [
    {
        "name": "M",
        "Reed": 12,
        "Gary": 13
    },
    {
        "name": "T",
        "Reed": 7,
        "Gary": 18
    },
    {
        "name": "W",
        "Reed": 32,
        "Gary": 14
    },
    {
        "name": "T",
        "Reed": 26,
        "Gary": 20
    },
    {
        "name": "F",
        "Reed": 16,
        "Gary": 26
    },
    {
        "name": "S",
        "Reed": 8,
        "Gary": 22
    },
    {
        "name": "S",
        "Reed": 24,
        "Gary": 30
    }
]

export default function LineGraph() {
    const colors = ["#fea320", "#932bad", "#eb4946", ]
    return (
        <ResponsiveContainer width="110%" height={200}>
            <LineChart data={realData}
                margin={{ top: 5, right: 60, left: -40, bottom: 5 }}>
                <CartesianGrid strokeDasharray="3 3" stroke="white" />
                <XAxis dataKey="name" stroke="white" strokeWidth="2"/>
                <YAxis fontSize="10px" stroke="white" strokeWidth="2" />
                <Tooltip />
                <Legend iconSize={20} style={{fontSize: "200px"}} />
                {keys.map((key, index) => <Line type="monotone" dataKey={key} stroke="#fea320" strokeWidth="4" dot={{strokeWidth: "5"}} />)}
                <Line type="monotone" dataKey="Reed" stroke="#fea320" strokeWidth="4" dot={{strokeWidth: "5"}} />
                <Line type="monotone" dataKey="Gary" stroke="#932bad" strokeWidth="4" dot={{strokeWidth: "5"}} />
            </LineChart>
        </ResponsiveContainer>
    )
}
